// File: contracts/ISHI/contracts/ISHI.sol


pragma solidity 0.8.21;









interface IWETH is IERC20 {
    function deposit() external payable;

    function withdraw(uint256) external;
}

contract ISHI is ERC20, Ownable {
    using SafeERC20 for IERC20;
    using Address for address payable;

    uint256 public maxTxAmount;
    uint256 public maxWallet;
    bool public swapEnabled = true;

    bool public inSwap;
    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    mapping(address => bool) public isFeeExempt;
    mapping(address => bool) public isTxLimitExempt;
    mapping(address => bool) public canAddLiquidityBeforeLaunch;

    uint256 private liquidityFee;
    uint256 private jackpotFee;
    uint256 private marketingFee;
    uint256 private devFee;
    uint256 private totalFee;
    uint256 public feeDenominator = 100;

    // Buy Fees
    uint256 public liquidityFeeBuy = 5;
    uint256 public jackpotFeeBuy = 10;
    uint256 public marketingFeeBuy = 5;
    uint256 public devFeeBuy = 10;
    uint256 public totalFeeBuy = 30;
    // Sell Fees
    uint256 public liquidityFeeSell = 10;
    uint256 public jackpotFeeSell = 10;
    uint256 public marketingFeeSell = 10;
    uint256 public devFeeSell = 20;
    uint256 public totalFeeSell = 50;

    // Fees receivers
    address payable private liquidityIncentiveWallet;
    address payable private marketingWallet;
    address payable public jackpotWallet;
    address payable private devWalletOne;
    address payable private devWalletTwo;

    uint256 public launchedAt;
    uint256 public launchedAtTimestamp;
    bool private initialized;

    IUniswapFactory private immutable factory =
        IUniswapFactory(0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f);
    IUniswapRouter private immutable swapRouter =
        IUniswapRouter(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
    IWETH private immutable WETH =
        IWETH(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);
    address private constant DEAD = 0x000000000000000000000000000000000000dEaD;
    address private constant ZERO = 0x0000000000000000000000000000000000000000;

    address public pair;

    constructor(
        address _liquidityIncentiveWallet,
        address _marketingWallet,
        address _jackpotWallet,
        address _devWalletOne,
        address _devWalletTwo
    ) ERC20("Ishikawa Goemon", "ISHI") {
        uint256 _totalSupply = 1_000_000 * 1e18;
        maxTxAmount = (_totalSupply * 2) / 100; //2%
        maxWallet = (_totalSupply * 2) / 100; //2%
        liquidityIncentiveWallet = payable(_liquidityIncentiveWallet);
        marketingWallet = payable(_marketingWallet);
        jackpotWallet = payable(_jackpotWallet);
        devWalletOne = payable(_devWalletOne);
        devWalletTwo = payable(_devWalletTwo);
        canAddLiquidityBeforeLaunch[_msgSender()] = true;
        canAddLiquidityBeforeLaunch[address(this)] = true;
        isFeeExempt[msg.sender] = true;
        isTxLimitExempt[msg.sender] = true;
        isFeeExempt[address(this)] = true;
        isTxLimitExempt[address(this)] = true;
        _mint(_msgSender(), _totalSupply);
    }

    function initializePair() external onlyOwner {
        require(!initialized, "Already initialized");
        pair = factory.createPair(address(WETH), address(this));
        initialized = true;
    }

    receive() external payable {}

    function transfer(
        address to,
        uint256 amount
    ) public virtual override returns (bool) {
        return _ISHITransfer(_msgSender(), to, amount);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        address spender = _msgSender();
        _spendAllowance(sender, spender, amount);
        return _ISHITransfer(sender, recipient, amount);
    }

    function _ISHITransfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool) {
        if (inSwap) {
            _transfer(sender, recipient, amount);
            return true;
        }
        if (!canAddLiquidityBeforeLaunch[sender]) {
            require(launched(), "Trading not open yet");
        }
        checkWalletLimit(recipient, amount);
        checkTxLimit(sender, amount);

        // Set Fees
        if (sender == pair) {
            buyFees();
        }
        if (recipient == pair) {
            sellFees();
        }
        if (shouldSwapBack()) {
            swapBack();
        }
        uint256 amountReceived = shouldTakeFee(sender)
            ? takeFee(sender, amount)
            : amount;
        _transfer(sender, recipient, amountReceived);
        return true;
    }

    // Internal Functions
    function shouldSwapBack() internal view returns (bool) {
        return
            !inSwap &&
            swapEnabled &&
            launched() &&
            balanceOf(address(this)) > 0 &&
            _msgSender() != pair;
    }

    function swapBack() internal swapping {
        uint256 taxAmount = balanceOf(address(this));
        _approve(address(this), address(swapRouter), taxAmount);

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = address(WETH);

        uint256 balanceBefore = address(this).balance;

        swapRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            taxAmount,
            0,
            path,
            address(this),
            address(0),
            block.timestamp
        );

        uint256 amountETH = address(this).balance - balanceBefore;

        uint256 amountETHLiquidity = (amountETH * liquidityFee) / (totalFee);
        uint256 amountETHJackpot = (amountETH * jackpotFee) / totalFee;
        uint256 amountETHMarketing = (amountETH * marketingFee) / totalFee;
        uint256 amountETHDevOne = (amountETH * devFee) / (totalFee * 2);
        uint256 amountETHDevTwo = amountETH -
            amountETHLiquidity -
            amountETHJackpot -
            amountETHMarketing -
            amountETHDevOne;
        liquidityIncentiveWallet.sendValue(amountETHLiquidity);
        jackpotWallet.sendValue(amountETHJackpot);
        marketingWallet.sendValue(amountETHMarketing);
        devWalletOne.sendValue(amountETHDevOne);
        devWalletTwo.sendValue(amountETHDevTwo);
    }

    function launched() internal view returns (bool) {
        return launchedAt != 0;
    }

    function buyFees() internal {
        liquidityFee = liquidityFeeBuy;
        jackpotFee = jackpotFeeBuy;
        marketingFee = marketingFeeBuy;
        devFee = devFeeBuy;
        totalFee = totalFeeBuy;
    }

    function sellFees() internal {
        liquidityFee = liquidityFeeSell;
        jackpotFee = jackpotFeeSell;
        marketingFee = marketingFeeSell;
        devFee = devFeeSell;
        totalFee = totalFeeSell;
    }

    function shouldTakeFee(address sender) internal view returns (bool) {
        return !isFeeExempt[sender] && launched();
    }

    function takeFee(
        address sender,
        uint256 amount
    ) internal returns (uint256) {
        uint256 feeAmount = (amount * totalFee) / feeDenominator;
        _transfer(sender, address(this), feeAmount);
        return amount - feeAmount;
    }

    function checkWalletLimit(address recipient, uint256 amount) internal view {
        if (
            recipient != owner() &&
            recipient != address(this) &&
            recipient != address(DEAD) &&
            recipient != pair
        ) {
            uint256 heldTokens = balanceOf(recipient);
            require(
                (heldTokens + amount) <= maxWallet,
                "Total Holding is currently limited, you can not buy that much."
            );
        }
    }

    function checkTxLimit(address sender, uint256 amount) internal view {
        require(
            amount <= maxTxAmount || isTxLimitExempt[sender],
            "TX Limit Exceeded"
        );
    }

    // Stuck Balances Functions
    function rescueToken(address tokenAddress) external onlyOwner {
        IERC20(tokenAddress).safeTransfer(
            msg.sender,
            IERC20(tokenAddress).balanceOf(address(this))
        );
    }

    function clearStuckBalance() external onlyOwner {
        uint256 amountETH = address(this).balance;
        payable(_msgSender()).sendValue(amountETH);
    }

    function getCirculatingSupply() public view returns (uint256) {
        return totalSupply() - balanceOf(DEAD) - balanceOf(ZERO);
    }

    /*** ADMIN FUNCTIONS ***/
    function launch() public onlyOwner {
        require(launchedAt == 0, "Already launched");
        launchedAt = block.number;
        launchedAtTimestamp = block.timestamp;
    }

    function setBuyFees(
        uint256 _liquidityFee,
        uint256 _jackpotFee,
        uint256 _marketingFee,
        uint256 _devFee
    ) external onlyOwner {
        liquidityFeeBuy = _liquidityFee;
        jackpotFeeBuy = _jackpotFee;
        marketingFeeBuy = _marketingFee;
        devFeeBuy = _devFee;
        totalFeeBuy =
            _liquidityFee +
            (_jackpotFee) +
            (_marketingFee) +
            (_devFee);
    }

    function setSellFees(
        uint256 _liquidityFee,
        uint256 _jackpotFee,
        uint256 _marketingFee,
        uint256 _devFee
    ) external onlyOwner {
        liquidityFeeSell = _liquidityFee;
        jackpotFeeSell = _jackpotFee;
        marketingFeeSell = _marketingFee;
        devFeeSell = _devFee;
        totalFeeSell =
            _liquidityFee +
            (_jackpotFee) +
            (_marketingFee) +
            (_devFee);
    }

    function setFeeReceivers(
        address _liquidityIncentiveWallet,
        address _marketingWallet,
        address _jackpotWallet,
        address _devWalletOne,
        address _devWalletTwo
    ) external onlyOwner {
        liquidityIncentiveWallet = payable(_liquidityIncentiveWallet);
        marketingWallet = payable(_marketingWallet);
        jackpotWallet = payable(_jackpotWallet);
        devWalletOne = payable(_devWalletOne);
        devWalletTwo = payable(_devWalletTwo);
    }

    function setMaxWallet(uint256 amount) external onlyOwner {
        require(amount >= totalSupply() / 100);
        maxWallet = amount;
    }

    function setTxLimit(uint256 amount) external onlyOwner {
        require(amount >= totalSupply() / 100);
        maxTxAmount = amount;
    }

    function setIsFeeExempt(address holder, bool exempt) external onlyOwner {
        isFeeExempt[holder] = exempt;
    }

    function setIsTxLimitExempt(
        address holder,
        bool exempt
    ) external onlyOwner {
        isTxLimitExempt[holder] = exempt;
    }

    function setSwapBackSettings(bool _enabled) external onlyOwner {
        swapEnabled = _enabled;
    }
}
